import logo from './hulogo.png';
import './App.css';
import Header from './Header.js';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  return (
    <div className="App">
      <Header />
        <div className="row">
          <div className="col">Column 1</div>
          <div className="col">Column 2</div>
          <div className="col">Column 3</div>
        </div>
    </div>
  );
}
export default App;
